export class Login {
  constructor(login) {
    this.username = login.username;
    this.password = login.password;
    this.rememberMe = login.rememberMe ?? false;
    this.email = login.email ?? "";
    this.firstName = login.firstName ?? "";
    this.lastName = login.lastName ?? "";
  }
}
